import React from 'react'

import classes from '../CSS/Toolbar.module.css'

const toolbar = (props) => {
	return (
		<header className = {classes.Toolbar}>
			<p>Drawer</p>
			<p>Logo</p>
			<nav className = {classes.DesktopOnly}>
				<p>Navigation Items</p>
			</nav>
		</header>
	)
}

export default toolbar;
